import React, { Component } from "react";
import "../App.css";
import { Player } from "video-react";
import ReactPlayer from "react-player";

export class Videos extends Component {
  render() {
    return (
      <div class="parent">
        <div class="child">
          <ReactPlayer url="../resources/video1.mp4" playing />
        </div>
        <div class="child">
          <video width="300" height="480" id="v2" alt="2" controls>
            <source src="../resources/video2.MP4" type="video/mp4" />
          </video>
        </div>
        <div class="child">
          <video width="300" height="480" id="v3" alt="2" controls>
            <source src="../resources/video3.MP4" type="video/mp4" />
          </video>
        </div>
      </div>
    );
  }
}
export default Videos;
